  const url = Router.pathname;
  if (url === "")
    return (
      <>
        <DefaultLayout className="center">
          <main>
            <section>
              <Social></Social>
              <img
                className="avatar"
                src="./img/octocat.png"
                alt="diana avatar"
              />
            </section>
            <section>
              <h1>
                <Link href="/">
                  <a> Diana Hern√°ndez </a>
                </Link>
              </h1>
              <h2>Desarrollo web</h2>

              <Link href="/blog">
                <a className="getStarted">BLOG</a>
              </Link>
            </section>
          </main>
        </DefaultLayout>
        <style jsx>{home}</style>
      </>
    );
}
